class Solution {
public:
    int maxOperations(string s) {
        int n=s.size();
        int c=0,ans=0;




        for(int i=n-1;i>=0;i--){
            if(s[i]=='0'){
                c++;
                while(i>=0&&s[i]=='0'){
                    i--;
                }
                i++;
            }
            else{
                ans+=c;
            }
        }
        return ans;
    }
};
